import React from "react";

const Animais = () => (
  <main>
    <h1>Animais para Adoção</h1>
    <section className="animais-grid">
      <div style={{background: "#e0e7ff", padding: "1rem", borderRadius: "8px"}}>Animal 1</div>
      <div style={{background: "#e0e7ff", padding: "1rem", borderRadius: "8px"}}>Animal 2</div>
      <div style={{background: "#e0e7ff", padding: "1rem", borderRadius: "8px"}}>Animal 3</div>
    </section>
  </main>
);

export default Animais;
